import React from "react";

const Header = ({ tittle }) => {
  return (
    <div className=" right-[50%] absolute">
      <nav className="bg-black text-center relative">
        <a href="/" className=" text-white  text-2xl font-semibold ">
          {tittle}
        </a>
      </nav>
    </div>
  );
};

export default Header;
